import "./App.css";

const App = () => {
  const mensaje = "Hola Mundo";
  const a = 10;
  const b = 2;

  return (
    <div className="App">
      {mensaje + " desde JSX"}
      <br />
      {/* Siempre que hay llaves se realiza una evalucacion */}
      {a + b}
      {+new Date()} {/* Me da el timestamp value */}
    </div>
  );
};

export default App;
